@rhymezx_code @query from my current project using Room queries in #AndroidDev:

Why did I put the query into its own string? So I can write a test on that query with EXPLAIN and assert it uses its index correctly.

#100DaysOfCode https://t.co/aZk91EtT9D

@rhymezx_code @query Nothing different just take out the excess delimiters and spaces. (If the computer generated the query it should of course put them in.)

@Query
("SELECT * FROM Cars WHERE color = 'red' AND car = 'Toyota' ORDER BY `createdAt` DESC LIMIT 10")

